1997年、イスラエルに1号店が開かれたSABON。<BR>
オーストラリアの伝統製法に則って作られたソープの<BR>
作り立てを量り売りしたのが始まり。<BR>
高品質な原材料のみを使い、香りや手触り、<BR>
さらにパッケージにもこだわっています。<BR>
<BR>
スクラブは、死海の塩をベースにしています。<BR>
塩のスクラブ効果に加えて、アーモンドオイル、ホホバオイル、<BR>
貴重なボラージオイルなどの自然由来の原料を惜しみなく使っています。<BR>
オイルの保湿効果で、しっとりとした、滑らかでつるつるな肌に導きます。<BR>
スクラブには、古い角質を取り除き、マッサージ効果で血行を促進します。<BR>
<BR>
<BR>
※ラッピングをご希望される方へ※<br>
